import React from "react";

class Home extends React.Component {
    constructor(props) {
        super(props);

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        window.alert(event.target.value);
        localStorage.setItem('type', event.target.value);
    }

    handleSubmit(event) {
        alert('Your favorite flavor is: ' + this.state.value);
    }

    render() {
        return (
            <div>
                <h2 className="text-center text-white">Logget inn som:</h2>
                <h1 className="text-center text-white"><b>userName</b></h1>
                <div className="d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="p-2 flex-grow-1">
                        <p className="text-center text-white">Fra</p>
                        <input type="datetime-local" className="form-control"/>
                    </div>
                    <div className="p-2 flex-grow-1">
                        <p className="text-center text-white">Til</p>
                        <input type="datetime-local" className="form-control"/>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
